import React, { useState } from "react";
import s from "./features.module.scss";
import malowanie from "../../assets/alpfoto/zakres/malowaniee.png";
import renowacja from "../../assets/alpfoto/zakres/renowacja.png";
import mycie from "../../assets/alpfoto/zakres/mycie.png";
import montaz from "../../assets/alpfoto/zakres/montaz.png";
import ptak from "../../assets/alpfoto/zakres/ptaki.png";
import dekarka from "../../assets/alpfoto/zakres/dekarka.png";
import banery from "../../assets/alpfoto/zakres/banery.png";
import snieg from "../../assets/alpfoto/zakres/snieg.png";

export const Zakres = () => {
  return (
    <div className={s.margin}>
      {" "}
      <h2>ZAKRES NASZEJ SPECJALIZACJI</h2>
      <div className={s.flex}>
        <div className={s.box}>
          <img className={s.img} src={malowanie}></img>
          <p>
            Świeżo wyglądająca elewacja to z pewnością wizytówka każdego
            budynku.
          </p>
        </div>
        <div className={s.box}>
          {" "}
          <img className={s.img} src={renowacja}></img>
          <p></p>
        </div>
        <div className={s.box}>
          {" "}
          <img className={s.img} src={mycie}></img>
          <p></p>
        </div>
        <div className={s.box}>
          {" "}
          <img className={s.img} src={montaz}></img>
          <p></p>
        </div>
        <div className={s.box}>
          {" "}
          <img className={s.img} src={ptak}></img>
          <p></p>
        </div>
        <div className={s.box}>
          {" "}
          <img className={s.img} src={dekarka}></img>
          <p></p>
        </div>
        <div className={s.box}>
          {" "}
          <img className={s.img} src={banery}></img>
          <p></p>
        </div>
        <div className={s.box}>
          {" "}
          <img className={s.img} src={snieg}></img>
          <p></p>
        </div>
        <div className={s.box}>
          {" "}
          <img className={s.img} src={malowanie}></img>
          <p></p>
        </div>
      </div>
    </div>
  );
};
